import React, { Component } from 'react'

export default class Chat extends Component {


    convoIdMatchesMessageId = () => {
        if (this.props.message_conversation_id === this.props.conversation_id) {
            return `sender id: ${this.props.sender}`
        }
    }

    convoIdMatchesSenderId = () => {
        if (this.props.sender === this.props.user_id) {
            return `success`
        }
    }




    render() {
        return (
            <div>
                {this.convoIdMatchesMessageId()}
                {this.convoIdMatchesSenderId()}
            </div>
        )
    }
}
